import { Button, Table } from "reactstrap";


const DepartmentTable = () => {


    return (
        <Table striped responsive>
            <thead>
                <tr>
                    <th>Name</th>
                    <th></th>
                </tr>
            </thead>
            <tbody>

            </tbody>
        </Table>
    )
}

export default DepartmentTable;
